// comparison.tsx
import React, { FC, useState, useEffect } from 'react';
import { Modal, ModalContent, CloseButton } from './comparison.styled';
import Search from '../searchnum/searchnum';
import PaginaCards from '../pca/pca';

interface ComparisonProps {
  onClose: () => void;
}

interface Car {
  comments: string[];
  digits: string;
  is_stolen: boolean;
  model: string;
  model_year: number;
  operations: Array<any>;
  photo_url: string;
  region: {
    name: string;
    name_ua: string;
    slug: string;
    old_code: string;
    new_code: string;
  };
  stolen_details: any;
  vendor: string;
  vin: string;
}

const Comparison: FC<ComparisonProps> = ({ onClose }) => {
  const [carData, setCarData] = useState<Car | null | string>(null);
  const [searchNomer, setSearchNomer] = useState<string>("");

  useEffect(() => {
    const url = "https://baza-gai.com.ua/nomer/KA0007XB";
    const key = "9c16e05f3ed9a9d34bda42abd1fd91d5";

    const fetchData = async () => {
      try {
        const response = await fetch(url, { headers: { "Accept": "application/json", "X-Api-Key": key } });
        const data = await response.json();
        setCarData(data);
      } catch (error) {
        console.error("Error fetching car data:", error);
        setCarData("Error fetching data");
      }
    };

    fetchData();
  }, []); // Empty dependency array means this effect runs once when the component mounts

  return (
    <Modal>
      <CloseButton onClick={onClose}>Закрыть</CloseButton>
      <ModalContent>
        <Search setDataFromSearch={setCarData} setNomer={setSearchNomer} />
      </ModalContent>
      <ModalContent>
        <Search setDataFromSearch={setCarData} setNomer={setSearchNomer} />
      </ModalContent>
      {/* Add code here to display `carData` if needed */}
    </Modal>
  );
};

export default Comparison;
